class Solution {
    func countSubMultisets(_ nums: [Int], _ l: Int, _ r: Int) -> Int {
        let mod = 1_000_000_007
        let maxSum = nums.reduce(0, +)
        var dp = Array(repeating: 0, count: maxSum + 1)
        dp[0] = 1

        for num in nums {
            for j in stride(from: maxSum, through: num, by: -1) {
                dp[j] = (dp[j] + dp[j - num]) % mod
            }
        }

        var prefixSums = Array(repeating: 0, count: maxSum + 2)
        for i in 1...maxSum {
            prefixSums[i + 1] = (prefixSums[i] + dp[i]) % mod
        }

        func countInRange(_ x: Int) -> Int {
            return x >= 0 ? prefixSums[x + 1] : 0
        }

        return (countInRange(r) - countInRange(l - 1) + mod) % mod
    }
}
